import {  StyleSheet } from 'react-native';

export default function useStyles() {

    return StyleSheet.create({
        container: {
            flex: 1,
            backgroundColor: '#FFFFFF',
            justifyContent: 'center',
            alignItems: 'center',
          },
          button: {
            backgroundColor: 'rgba(0, 118, 185, 0.35)',
            borderRadius: 14,
            width: buttonWidth,
            paddingVertical: 10,
            paddingHorizontal: 20,
            alignSelf: 'center',
            marginVertical: 10,
          },
          buttonText: {
            color: '#ffffff',
            textAlign: 'center',
          },
        });
}
